import * as actionTypes from './actionsTypes'
const defaultState = {
    foucsd: false
}
export default (state = defaultState, action) =>{
    console.log('aaaa', action)
    if(action.type === actionTypes){
        return {
            foucsd: true
        }
    }
    if(action.type === actionTypesSEARCHFOCUS){
        return {
            foucsd: false
        }
    }
    return state
}
